const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const formatMessage = require('format-message');
const mWebSocket = 'ws://127.0.0.1:8765';
// const MathUtil = require('../../util/math-util');

/**
 * Icon svg to be displayed at the left edge of each extension block, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
const blockIconURI = 'data:image/svg+xml;base64,';
const menuIconURI = blockIconURI; 

class Scratch3WebSocketsBlocks {
    constructor (runtime, extensionId) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.isRunning = false;
        this.socketData = "";
        this.runtime = runtime;
    }


    /**
     * The key to load & store a target's pen-related state.
     * @type {string}
     */
    static get STATE_KEY () {
        return 'Scratch.websockets';
    }

    /**
     * @returns {object} metadata for this extension and its blocks.
     */

    getInfo () {
        return {
            id: 'websockets',
            name: formatMessage({
                id: 'websockets.categoryName',
                default: 'External Multiplayer Tools',
                description: 'Allows you to externally connect to other scratchers.'
            }),
            // menuIconURI: menuIconURI,
            blockIconURI: blockIconURI,
            // showStatusButton: true,
            blocks: [
                {
                    opcode: 'openSocket',
                    blockType: BlockType.COMMAND,
                    text: formatMessage({
                        id: 'websockets.openSocket',
                        default: 'open socket',
                        description: 'Start a websocket session.'
                    }),
                },
                {
                	opcode: 'closeSocket',
                    blockType: BlockType.COMMAND,
                    text: formatMessage({
                        id: 'websockets.closeSocket',
                        default: 'close socket',
                        description: 'End the websocket session.'
                    }),
                },
                {
                	opcode: 'getSocketState',
                    blockType: BlockType.BOOLEAN,
                    text: formatMessage({
                        id: 'websockets.getSocketState',
                        default: 'active',
                        description: 'Return whether websocket session is running.'
                    }),
                },
                {
                	opcode: 'sendData',
                    blockType: BlockType.COMMAND,
                    text: formatMessage({
                        id: 'websockets.sendData',
                        default: 'send on socket [DATA]',
                        description: 'Send data through the socket.'
                    }),
                    arguments: {
                        DATA: {
                            type: ArgumentType.STRING,
                            defaultValue: formatMessage({
                                id: 'websockets.defaultSendData',
                                default: '01010101',
                                description: 'Default data to send.'
                            })
                        }
                    }
                },
                {
                	opcode: 'fetchData',
                    blockType: BlockType.COMMAND,
                    text: formatMessage({
                        id: 'websockets.fetchData',
                        default: 'send command [COMMAND]',
                        description: 'Send a command to the server'
                    }),
                    arguments: {
                    	COMMAND: {
                    		type: ArgumentType.STRING,
                    		menu: 'serverCommands',
                    		defaultValue: "%_fetch",
                    		text: "refresh socket data",
                    	}
                    }
                },
                {
                	opcode: 'getSocketData',
                    blockType: BlockType.REPORTER,
                    text: formatMessage({
                        id: 'websockets.getSocketData',
                        default: 'socket data',
                        description: 'return stored socket data.'
                    }),
                },

            ],
            menus: {
            	serverCommands: [
            		{
            			value: '%_fetch',
            			text: 'refresh socket data',
            		},
            		{
            			value: '%_disconnect',
            			text: 'disconnect from client',
            		},

            	]
            }
        };
    }

    openSocket () {
    	if (this.isRunning == false) {
    		console.log("Starting socket.");
    		this.mWS = new WebSocket(mWebSocket);

    		const self = this; // the functions below are out of the scope
    		//check if connnecting to the server fails
    		this.mWS.onerror = function(){
    			self.isRunning = false;
    			console.log("failed to connect to the server.");
    		};
    		this.mWS.onopen = function(){
    			self.isRunning = true;
    			console.log("successfully connected to the server.");
    		}
    	}
    	else{
    		console.log("Socket is already open.");
    	}
    }

    closeSocket () {
        if (this.isRunning == true) {
    		console.log("Closing socket.");
    		this.mWS.close(1000,'script closure');
    		this.isRunning = false;
    	}
    	else{
    		console.log("Socket is not open.");
    	}
    }

   	getSocketState () {
   		//Check is the server is still running
   		if (this.isRunning){
   			var response = this.mWS.readyState;
   			if (response == 2 || response == 3) {
   				this.isRunning = false;
   				console.log("Server has disconnected.")
   			}
   		}
   		return this.isRunning;
   	}

   	sendData (args) {
   		if (this.isRunning == true) {
   			this.mWS.send(args.DATA);
   			console.log("SENT:", args.DATA);
   		}
   	}

   	fetchData (args) {
   		if (this.isRunning == true) {
   			this.mWS.send(args.COMMAND);
   			console.log("COMMAND:", args.COMMAND);
   			const self = this; // the function below is out of the scope
   			//Load response
   			var message = this.mWS.onmessage = function(event){
   				self.socketData = String(event.data);
   				console.log("RECEIVED:", self.socketData);
   			};
   		}
   		else{
   			this.socketData = "";
   		}		
   	}

   	getSocketData () {
   		//Check is the server is still running
   		return this.socketData;
   	}
}

module.exports = Scratch3WebSocketsBlocks;
